    setMessage('Hello');
  }

  const messages = [];
  const listMessages = messages.map((message) => {
    <p>{message}</p>
  })
  return (

        <div className='container'>
          <div className='chat-container'>
            <div className='chat'>

            </div>
          </div>
          <div className='chat-input-container'>
            <div className='chat-input'>
              <button onClick={handleAddQuestion()}>
                  Question
